import React, { useState } from "react";
import "./AdminDashboard.css";

const AdminDashboard = () => {
  const [students, setStudents] = useState([
    { id: 1, name: "John Doe", email: "john@student.com" },
    { id: 2, name: "Jane Smith", email: "jane@student.com" },
  ]);

  const [counselors, setCounselors] = useState([
    { id: 1, name: "Dr. Jane Smith", specialization: "Anxiety" },
    { id: 2, name: "Dr. Robert Johnson", specialization: "Depression" },
  ]);

  const handleAddStudent = () => {
    // Add logic to add a student
  };

  const handleDeleteStudent = (id) => {
    setStudents(students.filter((student) => student.id !== id));
  };

  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>
      <div className="students-section">
        <h2>Students</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {students.map((student) => (
              <tr key={student.id}>
                <td>{student.id}</td>
                <td>{student.name}</td>
                <td>{student.email}</td>
                <td>
                  <button onClick={() => handleDeleteStudent(student.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        <button onClick={handleAddStudent}>Add Student</button>
      </div>
      <div className="counselors-section">
        <h2>Counselors</h2>
        {/* Add similar logic for counselors */}
      </div>
    </div>
  );
};

export default AdminDashboard;
